import { Route, Routes } from "react-router-dom";
import Home from "./Home.tsx";
import CreateTxn from "./CreateTxn.tsx";

function Main() {
  return (
    <div className="content">
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route path="/create" element={<CreateTxn />} />
      </Routes>
    </div>
  );
}

export default Main;
